import React from 'react';
import './Header.css';
import MenuIcon from '@material-ui/icons/Menu';
import {IconButton} from '@material-ui/core';

function Header() {
  return (
    <div className="header">
      <div className="left-header">
          <IconButton>
        <MenuIcon/>
        </IconButton>
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pinterest.com%2Fpin%2F863143084828054435%2F&psig=AOvVaw14omKjZ35fBjojRLex-bH3&ust=1624716813182000&source=images&cd=vfe&ved=0CAoQjRxqFwoTCIDuuvX7svECFQAAAAAdAAAAABAI" alt="gmail-logo"/>
      </div>
      <div className="middle-header">
        
      </div>
      <div className="right-header">
        
      </div>
    </div>
  );
}

export default Header;
